Duration : 00:37:21 Description : We first met Luna during a Moneytalks shoot, and she hit it off with Tony right away. She called him up and asked him if he knew where she could buy an affordable motorcycle for her father for very little money. Tony jumped at the chance to get her over to the house and sell her an old motorcycle he had stored away in the garage. Peter, Tony's buddy, showed up to help clean up the bike and run it through a quick maintenance check. When Luna showed up, everyone knew she was willing to do much more than just pay for the bike. She got all dolled up to try and bring the price down. Peter let her know how she could get the bike for a super low price. All Luna had to do was pleasure Peter's peter. Video Format : MP4 Video codec : H.264 / AVC Audio codec : AAC Video : MPEG4 Video (H264) 768x432 29.97fps 1502kbps Audio : AAC 32000Hz mono 32kbps
